CREATE TABLE custos (
    Num_Nota INTEGER,
    Data TIMESTAMP,
    Semana TEXT,
    Descrição TEXT,
    Local TEXT,
    Valor FLOAT,
    id_categoria INTEGER,
    Categoria TEXT,
    Subcategoria TEXT
);


COMMENT ON TABLE custos              IS 'Armazena as despesas relacionadas ao projeto marmitas em acao ';
COMMENT ON COLUMN custos.Num_Nota    IS 'número da nota';
COMMENT ON COLUMN custos.data        IS 'Data em que a despesa foi registrada';
COMMENT ON COLUMN custos.semana      IS 'Dia da semana correspondente à data da despesa';
COMMENT ON COLUMN custos.descricao   IS 'Descrição do tipo de despesa realizada';
COMMENT ON COLUMN custos.Local       IS 'Estabelecimento onde foi efetuada a despesa';
COMMENT ON COLUMN custos.valor       IS 'Valor monetário da despesa';


UPDATE custos 
SET semana = to_char(data, 'Day');
